// src/components/ProfileTabs/ProfileTab.js
import React, { useState } from 'react';
import axios from 'axios';

const ProfileTab = ({ profileData, refreshProfile }) => {
  const [formData, setFormData] = useState(profileData);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes('.')) {
      const [parent, child] = name.split('.');
      setFormData({
        ...formData,
        [parent]: { ...formData[parent], [child]: value },
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      await axios.put('/api/profile', formData, {
        headers: { Authorization: `Bearer ${token}` },
      });
      refreshProfile(); // Refresh profile data after update
      alert('Profile updated successfully!');
    } catch (error) {
      console.error('Error updating profile:', error);
      alert('Failed to update profile.');
    }
  };

  if (!formData) {
    return <p>Loading...</p>;
  }

  const { progress } = formData;

  return (
    <div className="bg-background text-text">
      <h2 className="text-2xl font-semibold mb-4">Profile Information</h2>
      <div className="w-full bg-gray-700 rounded-full h-6 mb-4">
        <div
          className="bg-primary h-6 rounded-full text-center text-sm font-medium leading-6"
          style={{ width: `${progress}%` }}
        >
          {progress}% Complete
        </div>
      </div>
      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Name */}
        <div>
          <label htmlFor="name" className="block text-sm font-medium">
            Name
          </label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name || ''}
            onChange={handleChange}
            required
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
        </div>
        {/* Email */}
        <div>
          <label htmlFor="email" className="block text-sm font-medium">
            Email
          </label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email || ''}
            onChange={handleChange}
            required
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
        </div>
        {/* Company */}
        <div>
          <label htmlFor="company" className="block text-sm font-medium">
            Company
          </label>
          <input
            type="text"
            id="company"
            name="company"
            value={formData.company || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
        </div>
        {/* Phone */}
        <div>
          <label htmlFor="phone" className="block text-sm font-medium">
            Phone
          </label>
          <input
            type="text"
            id="phone"
            name="phone"
            value={formData.phone || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
        </div>
        {/* Address */}
        <div>
          <label className="block text-sm font-medium">Address</label>
          <input
            type="text"
            id="street"
            name="address.street"
            placeholder="Street"
            value={formData.address?.street || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
          <input
            type="text"
            id="city"
            name="address.city"
            placeholder="City"
            value={formData.address?.city || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
          <input
            type="text"
            id="state"
            name="address.state"
            placeholder="State"
            value={formData.address?.state || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
          <input
            type="text"
            id="zip"
            name="address.zip"
            placeholder="ZIP Code"
            value={formData.address?.zip || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          />
        </div>
        {/* Bio */}
        <div>
          <label htmlFor="bio" className="block text-sm font-medium">
            Bio
          </label>
          <textarea
            id="bio"
            name="bio"
            rows="4"
            value={formData.bio || ''}
            onChange={handleChange}
            className="mt-1 block w-full rounded-md bg-surface border-gray-600 text-text focus:border-primary focus:ring focus:ring-primary focus:ring-opacity-50"
          ></textarea>
        </div>
        {/* Submit Button */}
        <div>
          <button
            type="submit"
            className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md text-sm font-medium text-text bg-primary hover:bg-primary-dark focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary"
          >
            Save Profile
          </button>
        </div>
      </form>
    </div>
  );
};

export default ProfileTab;
